  false,\n\t\"url\": null,\n\t\"notes\": \"To determine the relative needs of the
  U.S. Fish and Wildlife Service, the Federal Highway Administration (FHWA) was asked
  to inventory all public access roads and parking lots and provide a condition assessment
  of each.  In 2008 the inventory was expanded to includeadministrative (service use
  only) roads and parking lots. An FHWA representative meets withrefuge personnel
  to identify route segments and assign route numbers and functionalclassifications
  (See Appendix) for each route. All roads and parking lots are mapped usingTrimble
  GPS units and visually assessed for condition using the RSL method of evaluationdeveloped
  at Utah State University (See Appendix). Culverts, Gates, Guardrails and Low WaterCrossings
  are also mapped and inspected for any obvious defects.\",\n\t\"license_title\":
